import React, { Component } from 'react';
import { Card, CardBody, CardHeader, Col, Row, Table } from 'reactstrap';
import {BootstrapTable, TableHeaderColumn} from 'react-bootstrap-table';
import DateRangePicker from 'react-bootstrap-daterangepicker';
import 'bootstrap-daterangepicker/daterangepicker.css';
import usersData from './UsersData'
import * as moment from 'moment/moment';

class User extends Component {
 constructor(props) {
   super(props);
   this.state = {};
 }
  render() {
    const options = {
      expandRowBgColor: '#efefef',
      expandAll: true,
      paginationShowsTotal: this.renderShowsTotal,
    };

    const user = usersData.find( user => user.id.toString() === this.props.match.params.id)

    const userDetails = user ? Object.entries(user) : [['id', (<span><i className="text-muted icon-ban"></i> Not found</span>)]]

    return (
      <div className="animated fadeIn">
        <Row>
          <Col lg={6}>
            <Card>
              <CardHeader>
                <strong><i className="icon-info pr-1"></i>User id: {this.props.match.params.id}</strong>
              </CardHeader>
              <CardBody>
                 <div className='form-group'>
                  <DateRangePicker 
                    startDate={this.state.startDateDR} 
                    endDate={this.state.endDate}
                    onEvent={this.handleChangeDatePicker}
                    showWeekNumbers
                    >
                    <Button onClick={this.onClick}>
                      <i className="fa fa-calendar"/>
                      <span> {this.state.labelCal}</span>                          
                    </Button>            
                  </DateRangePicker>
                </div>
                 {/*<button onClick={this.getSelectedRowKeys.bind(this)}>Get selected row keys</button>*/}
                <BootstrapTable data={ contentData } remote={ this.remote } selectRow={ selectRowProp } cellEdit={ cellEditProp } height='100%' pagination scrollTop={ 'Bottom' } hover condensed striped exportCSV
                   expandableRow={ this.isExpandableRow } expandComponent={ this.expandComponent } options={ options } deleteRow={ true }>
                  <TableHeaderColumn ref='idFetch' dataField='idFetch' isKey={ true } dataAlign='center' width='100'>ID</TableHeaderColumn>
                  <TableHeaderColumn ref='intent' dataField='intent' filter={ { type: 'TextFilter' } } headerAlign='center' editable={ { type: 'textarea' , validator: this.jobStatusValidator } } invalidEditColumnClassName={ this.invalidJobStatus }>intent</TableHeaderColumn>
                  <TableHeaderColumn ref='entity' dataField='entity' filter={ { type: 'TextFilter'} } headerAlign='center' tdStyle={ { whiteSpace: 'normal' } } editable={ { type: 'textarea' , validator: this.jobStatusValidator } } invalidEditColumnClassName={ this.invalidJobStatus }>entity</TableHeaderColumn>
                  <TableHeaderColumn ref='uri' dataField='uri' filter={ { type: 'TextFilter' } } headerAlign='center' tdStyle={ { whiteSpace: 'normal' } } editable={ { type: 'textarea' , validator: this.jobStatusValidator } } invalidEditColumnClassName={ this.invalidJobStatus }>uri</TableHeaderColumn>
                  <TableHeaderColumn ref='source' dataField='source' filter={ { type: 'TextFilter' } } headerAlign='center' editable={ { type: 'textarea' , validator: this.jobStatusValidator } } invalidEditColumnClassName={ this.invalidJobStatus }>source</TableHeaderColumn>
                  <TableHeaderColumn ref='content_type' dataField='content_type' filter={ { type: 'TextFilter' ,placeholder : 'please enter a value'} } headerAlign='center' editable={ { type: 'textarea' , validator: this.jobStatusValidator } } invalidEditColumnClassName={ this.invalidJobStatus }>Content Type</TableHeaderColumn>
                  <TableHeaderColumn ref='createtime' dataField='createtime' filter={ { type: 'TextFilter' } } headerAlign='center'>createtime</TableHeaderColumn>
                  <TableHeaderColumn ref='updatetime' dataField='updatetime' filter={ { type: 'TextFilter'} }  headerAlign='center'>updatetime</TableHeaderColumn>
                </BootstrapTable>
              </CardBody>
            </Card>
          </Col>
        </Row>
      </div>
    )
  }
}

export default User;
